import React from 'react';
import { Link } from 'react-router-dom';
import '../Css/Navbar.css';
import Logo from '../myList Logo.svg';

export const Navbar = () => {
    return (
        <div className="navbar">
            <div className="navbar-section">
                <Link className="logo" to="/">
                    <img src={Logo}></img>
                </Link>
                <div className="links">
                    
                </div>

            </div>
        </div>
    )
}

